import React, { useRef }  from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import ReactDOM from 'react-dom/client';
import './index.css';
import doctor from './doctor(2).png';
import patient from './patient(1).png';
import main from './main';
import reportWebVitals from './reportWebVitals';

function Login() {
  const divRef1 = useRef(null);
  const divRef2= useRef(null);
  const currentDisplay1 = divRef1.current.style.display;
  const currentDisplay2 = divRef1.current.style.display;
  const doclogin = () => {


    divRef1.current.style.display = currentDisplay === 'block';

  };

  const patlogin = () => {};

  return (
    <div className='main'>
      <div className='logo'>
        <h1>MEDIsync</h1>
        <p>Wellness in Your Hands, Anytime, Anywhere !!!</p>
      </div>
      <div className='loginarea'>
        <div className='logon'>
          <div className='switch'>
            <button className='s' id='doctor' onClick={doclogin} ref={divRef1}>
              <img src={doctor} alt="doctor" className='doc' /><p>Doctor</p>
            </button>
            <button className='s' id='patient' onClick={patlogin} ref={divRef2}>
              <img src={patient} alt="patient" className='pat' /><p>Patient</p>
            </button>
          </div>
          <h1 className='login'>Login</h1>
          <div className='data_pat' >
            <input type="text" placeholder='email' />
            <br />
            <input type="number" placeholder='Application no' />
          </div>
          <div className='data_doc' >
            <input type="text" placeholder='email' />
            <br />
            <input type="password" placeholder='password' />
          </div>
          <button className='submit'>Login</button>
          <p className='register'><Link to="/register">Not yet Registered?</Link></p>



        </div>
      </div>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <Login />
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
